import React from "react";
import { Routes, BrowserRouter, Route } from "react-router-dom";
import "./App.css";
import Dialogs from "./components/Dialogs/Dialogs";
import Header from "./components/Header/Header";
import Navbar from "./components/nav/nav";
import Profile from "./components/profile/Profile";
import News from "./components/News/news";
import Music from "./components/Music/music";
import Settings from "./components/Settings/settings";

function App(props) {
  let postData = [
    {
      names: "Danny",
      id: 0,
      message: "Hi, bird, how are you?!",
      likeCount: "15",
    },
    { names: "Danny", id: 1, message: "Lets fire", likeCount: "10" },
    { names: "Danny", id: 2, message: "U smell like sheep", likeCount: "7" },
    { names: "Danny", id: 3, message: "Hi bro", likeCount: "2" },
  ];

  return (
    <BrowserRouter>
      <div className="app-wrapper">
        <Header />
        <Navbar />
        <div className="app-wrapper-content">
          <Routes>
            <Route
              path="/Profile"
              render={() => <Profile postData={postData} />}
            />
            <Route path="/Dialogs" element={<Dialogs />} />
            <Route path="/News" element={<News />} />
            <Route path="/Music" element={<Music />} />
            <Route path="/Settings" element={<Settings />} />
          </Routes>
        </div>
      </div>
    </BrowserRouter>
  );
}

export default App;
